  private onSearchString(allIcons:any,searchStr: string) {
    searchStr=searchStr.split(" ")[1];
    console.log(searchStr);
    let icons=allIcons.filter(function (item: string) {
      return JSON.stringify(item).toLowerCase().includes(searchStr);

    })
    console.log(icons);
    return icons
  }
  public getIcon(graphpod: IGraphpod, nIPropertyId: string, nodeIndex: string) {
    try {
      let result = null;
      let allIcons = _.clone(this.getAllIcon());

      if (nodeIndex != null) {
        if (graphpod.nodeInfo[nodeIndex].nodeIconInfo != null) {
          let tempPInfo = graphpod.nodeInfo[nodeIndex].nodeIconInfo.propertyInfo;
          let tempType = graphpod.nodeInfo[nodeIndex].nodeIconInfo.type;
          if (tempPInfo != null && tempPInfo.length > 0 &&
            graphpod.nodeInfo[nodeIndex].nodeIconInfo.propertyType == 'CUSTOM') {
            for (let i = 0; i < tempPInfo.length; i++) {
              if (tempType == 'numerical') {
                if (tempPInfo[i].endRange != null
                  && nIPropertyId >= tempPInfo[i].startRange
                  && nIPropertyId <= tempPInfo[i].endRange) {
                  result = tempPInfo[i].propertyValue;
                  break;
                }
                if (tempPInfo[i].endRange == null
                  && nIPropertyId >= tempPInfo[i].startRange) {
                  result = tempPInfo[i].propertyValue;
                  break;
                }
              }
              else {
                if (nIPropertyId == tempPInfo[i].propertyName) {
                  result = tempPInfo[i].propertyValue;
                  break;
                }
              }
            }
          } else {
            result = graphpod.nodeInfo[nodeIndex].nodeIconInfo.propertyDefaultValue;
          }
        }
        
        if (result != null) {
          if(graphpod.nodeInfo[nodeIndex].nodeIconInfo.propertyDefaultValue.indexOf("fa") !=-1){
            let tempCode=this.onSearchString(allIcons,graphpod.nodeInfo[nodeIndex].nodeIconInfo.propertyDefaultValue);
            tempCode=tempCode[0].class;
           return tempCode;
          }else{
            let tempCode = this.lconMap[result].class;
            return tempCode;
          }
        } else {
          if(graphpod.nodeInfo[nodeIndex].nodeIconInfo.propertyDefaultValue.indexOf("fa") !=-1){
            let tempCode=this.onSearchString(allIcons,graphpod.nodeInfo[nodeIndex].nodeIconInfo.propertyDefaultValue);
            tempCode=tempCode[0].class;
           return tempCode;
          }else{
            return this.lconMap[graphpod.nodeInfo[nodeIndex].nodeIconInfo.propertyDefaultValue].class;
          }
        }
      }
      else {
        return "fa fa-circle";
      }
    } catch (Error) {
      console.log(nodeIndex)
      console.log("not fount" + Error.message);
      return "fa fa-circle";
    }
  }
